fn call_fn_mut <F>(f: &mut F) where F: FnMut() { f(); }
fn call_fn <F>(f: &F) where F: Fn() { f(); } fn main() { let a = A { value: 0 }; let closure_fn_once = || { println!("closure_fn_once"); drop(a); };
// closure_fn_once();
